import React, { Component } from 'react';

export class NavBar extends Component {
  defaultProps = {
    title: 'Github Finder',
    icon: 'fab fa-github'
  };

  render() {
    return (
      <nav className='navbar bg-primary'>
        <h1>
          <i className={this.props.icon}> {this.props.title}</i>
        </h1>
      </nav>
    );
  }
}
